// App.js

import React, { useState, useEffect } from 'react';
import classes from './App.module.css';
import './App.css';

import image1 from './1.jpg';
import image2 from './2.jpg';
import image3 from './3.jpg';
import image4 from './4.jpg';
import image5 from './5.jpg';
import image6 from './6.jpg';
import icon from './menu.png';
import search from './search.png';
import logo from './logo.png';
import backgroundVideo from './3D House Animation_1.mp4';
import p1 from './P3.jpg';
import p2 from './p4.jpeg';

import s1 from './s1.png';
import s2 from './s2.png';
import s3 from './s3.png';
import s4 from './s4.png';
import s5 from './s5.png';
import s6 from './s6.png';
import s7 from './s7.png';
import s8 from './s8.png';
import s9 from './s9.png';
import s10 from './s10.png';
import s11 from './s11.png';
import s12 from './s12.png';
import s13 from './s13.png';
import s14 from './s14.png';
import b4 from './b5.jpg';
import b5 from './b6.jpeg';

import t1 from './twitter.png';
import t2 from './whatsapp.png';
import t3 from './youtube.png';
import t4 from './instagram.png';
import t5 from './facebook (1).png';
import t6 from './linkedin.png';
import t7 from './Arrow.png';

function App() {
  const images = [image1, image3, image4, image5, image6];
  const [currentImageIndex, setCurrentImageIndex] = useState(0);
  const [isHeaderVisible, setIsHeaderVisible] = useState(true);
  const [isFirstBlock, setIsFirstBlock] = useState(true);

  const [email, setEmail] = useState('');
  const [isSubscribed, setIsSubscribed] = useState(false);
  const [error, setError] = useState('');

  const handleSubscribe = () => {
    if (email) {
      setIsSubscribed(true);
      setError('');
    } else {
      setError('Please add Email');
    }
  };

  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentImageIndex((prevIndex) => (prevIndex + 1) % images.length);
    }, 5000);
    return () => clearInterval(interval);
  }, [images.length]);

  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > window.innerHeight) {
        setIsHeaderVisible(false);
      } else {
        setIsHeaderVisible(true);
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  return (
    <div className={classes.container}>
      <div className={classes.header} style={{ transform: isHeaderVisible ? 'translateY(0)' : 'translateY(-100%)' }}>
        <div className={classes.logoContainer}>
          <img src={logo} alt="Logo" className={classes.logo} />
        </div>
        <div className={classes.iconsContainer}>
          <button className={classes.searchButton}>
            <img src={search} alt="Search Icon" className={classes.searchIcon} />
          </button>
          <button className={classes.menuButton}>
            <img src={icon} alt="Menu Icon" className={classes.menuIcon} />
          </button>
        </div>
      </div>

      <div className={classes.firstBlock}>
        <video autoPlay muted loop className={classes.backgroundVideo}>
          <source src={backgroundVideo} type="video/mp4" />
        </video>
        <div className={classes.textContainer}>
          <span>Design your Future</span>
          <div className={classes.boldText}>BUILD YOUR DREAM</div>
        </div>
      </div>

      <div className={classes.secondBlock}>
        <div className={classes.overlay}></div>
        <div className={classes.secondBlockHeader}>Welcome to Our World</div>
        <div className={classes.secondBlockSubheader}>Crafting Excellence</div>
        <button className={classes.knowMoreButton}>Know More</button>
      </div>

      <div className={classes.thirdBlock}>
        <div className={classes.overlay}></div>
        <div className={classes.visionText}>Our Vision</div>
        <div className={`${classes.image} ${currentImageIndex === 0 ? classes.active : ''}`}>
          <img src={image1} alt="Vision" />
        </div>
        <div className={`${classes.image} ${currentImageIndex === 1 ? classes.active : ''}`}>
          <img src={image2} alt="Vision" />
        </div>
        <div className={`${classes.image} ${currentImageIndex === 2 ? classes.active : ''}`}>
          <img src={image3} alt="Vision" />
        </div>
      </div>

      <div className={classes.sixthBlock}>
        <div className={classes.imageTextContainer}>
          <img src={b5} className={classes.image1} alt="Commitment" />
          <div className={classes.overlayText}>Our Commitment to Excellence Provides unmatched product quality, coupled with speed, safety, and superior sales services.</div>
        </div>
      </div>
    </div>
  );
}

export default App;
